    static constexpr int COLS_BOUND_PER_NPC = ((COLS + (xfNPixelsPerCycle<NPC>::nppc - 1)) >> xfNPixelsPerCycle<NPC>::datashift);
    static constexpr int LOOPBOUND = ROWS * COLS_BOUND_PER_NPC;
